import { Link as RouterLink, useNavigate } from 'react-router-dom';

import React, { useState } from "react";

const Register = (props) => {
    const [user, setUser] = useState('');
    const [pass, setPass] = useState('');

    //const navigate = useNavigate();
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(user);
    }

    return (
        <div className='auth-form-container'>
        <form onSubmit={handleSubmit}>
            <h1>Register</h1>
            <label for='user'>Name</label>
            <input value={user} onChange={(e) => setUser(e.target.value)} type='user' placeholder='Your name' id='user' name='user' />
            <label for='password'>Password</label>
            <input value={pass} onChange={(e) => setPass(e.target.value)} type='password' placeholder='******' id='pass' name='pass' />
            <button type='submit'>Log In</button>
        </form>
        <button onClick={() => props.onFormSwitch('login')}>Already have an account? Log in</button>
        </div>
    );
};

export default Register;
